package xyz.lhweb.furns.bean;import java.util.Date;/** * 会员表 * * @author 罗汉 * @date 2023/04/01 */public class Member{ 	 private Integer id; 	 private String username; 	 private String password; 	 private String email; 	 public Member() {	}	public Member(Integer id, String username, String password, String email) {		this.id = id;		this.username = username;		this.password = password;		this.email = email;	}	public void setId(Integer id){ 		 this.id=id; 	 } 	 public Integer getId(){ 		 return this.id; 	 } 	 public void setUsername(String username){ 		 this.username=username; 	 } 	 public String getUsername(){ 		 return this.username; 	 } 	 public void setPassword(String password){ 		 this.password=password; 	 } 	 public String getPassword(){ 		 return this.password; 	 } 	 public void setEmail(String email){ 		 this.email=email; 	 } 	 public String getEmail(){ 		 return this.email; 	 }	@Override	public String toString() {		return "Member{" +				"id=" + id +				", username='" + username + '\'' +				", password='" + password + '\'' +				", email='" + email + '\'' +				'}';	}}